        function drawBackgroundColor() {
           
            var data = new google.visualization.DataTable();
            data.addColumn('string', 'X');
            data.addColumn('number', 'Equity');
            data.addColumn({ type: 'string', role: 'tooltip' });
            for (var i = 0; i < dateIndexArr.length; i++) {
                data.addRow([dateIndexArr[i][0], null,null]);
            }

            //for (var i = 0; i < unixJsonData.length; i++) {
            //    var dateNow = GetTime(unixJsonData[i][0]);
            //    data.addRow([dateNow, unixJsonData[i][1], `${unixJsonData[i][1]}|${moment(dateNow).format('h:mm  a') }`]);
            //}

            var options = {
                height: 300,
                legend: { position: 'none' },
                chartArea: {
                    left: "7%",
                    top: "4%",
                    height: "85%",
                    width: "85%"
                },
                legend: { position: 'none' },
                vAxis: {
                    format: 'short',
                    textStyle: { color: 'gray' },
                    'stroke-color': 'transparent',
                    textPosition: 'none',
                },
                hAxis: {
                    format: 'h:mm a',
                    textStyle: { color: 'gray' },
                    'stroke-color': 'transparent',
                    textPosition: 'none',
                },
                backgroundColor: { fill: 'transparent' }

            };
            // Create and draw the visualization.
            var v = new google.visualization.LineChart(document.getElementById('chart_div'));
            v.draw(data, options);

            // Quick example of updating
            var i = 15;
            setInterval(function () {
                // Add a new row of data
                var dateNow = new Date(moment(new Date()).format('LLL'));
                var index1 = dateIndexArr.findIndex(function (element) {
                    return element == moment(dateNow).format('h:mm a');
                });
                var obj = GetObject(moment(dateNow).format('H:mm'));
                var number = (Math.random() * (obj.high - obj.low)) + obj.low;
                number = parseFloat(number.toFixed("2"));
                if (index1 != -1) {
                    data.setCell(index1, 1, number);
                    data.setCell(index1, 2, `${number}|${moment(dateNow).format('h:mm  a')}`);
                } else {
                    dateIndexArr.push(moment(dateNow).format('h:mm a'));
                    data.addRow([dateNow, number, `${number}|${moment(dateNow).format('h:mm  a')}`]);
                }
              //  var dateNow = GetTime(unixJsonData[i][0]);
                
                //data.addRow([dateNow, number, `${number}|${moment(dateNow).format('h:mm  a')}`]);
               // insertRows(397, [dateNow, number, `${number}|${moment(dateNow).format('h:mm  a')}`]);
                // Remove the oldest row of data
                //data.removeRow(0);
                // Redraw the data
                v.draw(data, options);
            }, 1000);
        }

        function GetObject(time) {
            var n = unixJsonData.find(function (element) {
                return element.date == time;
            });
            return n;
        }

        function GetTime(unix_timestamp) {
            var date = new Date(unix_timestamp * 1000);
            //console.log(date.toLocaleString());
            dateIndexArr.push(moment(date).format('h:mm a'));
            return date; //moment(date).format('h:mm');
        }
    </script>
